  constructor(props) {
    super(props);
    
  }


  render() {
    return (
      <div className="App">
      <div className="container">
            <header title="Simple Firebase App" ></header>
            <div className="columns">
              <div className="column is-3"></div>
              <div className="column is-6">
      <RoomList firebase = {firebase}/>
      <MessageList firebase = {firebase} />
              </div>
              </div>
            </div>
       </div>
    );
  }
}

export default App;
